import React from 'react'
import "./Home.css";

function Home() {
    return (
        <div className="home">
            <div className="home__container">
                <img src="" alt="https://images-eu.ssl-images-amazon.com/images/G/02/digital/video/merch2016/Hero/Covid19/Generic/GWBleedingHero_ENG_COVIDUPDATE__XSite_1500x600_PV_en-GB.CB428684220_.jpg" alt="" />
            </div>
        </div>
    );
}

export default Home;
